import actions from './actions';

const {resetPassword} = actions;

const reset = ({password}) => {
    return async dispatch => {
        try {
        dispatch(resetPassword.begin());
        // send request to server to login and get token
        const response = await axios.post('https://api.develocity.finance/api/v1/admin/reset-password', {
            password,
        });
    
        if (response.status === 200) {
            return dispatch(resetPassword.success(response.data.result));
        }
        } catch (err) {
        console.log(err.response);
    
        dispatch(resetPassword.error(err.response.data.responseMessage));
        }
    };
    }
